import React from "react";
import Task from "./Task";

function TaskList(props){
    return (
      <div>
        {
          React.Children.toArray(
            props.list.map( (task) =>(
              <Task details={task.details}  id={task._id}
              />
            ))
          )
        }
      </div>
    );
}

export default TaskList;
